import React from "react";
import './../index.css';

var heading1 = {
    textAlign:"center",
    color:'green',
    backgroundColor:'white',
    display:'inline',
    padding:'15px',
    borderRadius:"20px",
    marginLeft:"25%",
    marginTop:"25%"
}

function Heading1(){
    return (
        
        <h1 style={heading1}>Hello Sir, <span className="">Good Morning</span></h1>
        
    )
}

export default Heading1;
